import './Tab3.css'
import * as React from 'react';
import Checkbox from '@mui/material/Checkbox';
import TextField from '@mui/material/TextField';
import Autocomplete from '@mui/material/Autocomplete';
import CheckBoxOutlineBlankIcon from '@mui/icons-material/CheckBoxOutlineBlank';
import CheckBoxIcon from '@mui/icons-material/CheckBox';
import Table from '../../components/table/table';
import Button from '@mui/material/Button';
import {useNavigate} from 'react-router-dom';

const icon = <CheckBoxOutlineBlankIcon fontSize="small" />;
const checkedIcon = <CheckBoxIcon fontSize="small" />;

export default function Tab3() {

  const navigate = useNavigate()
  const colleges = ['Aollege 1','College 2','Bollege 3','Aollege 4']
  const main = ['Main Ranking 1','Main Ranking 2'];
  const add = ['Additional Ranking 1', 'Additional Ranking 2'];
  const [college,setCollege] = React.useState([])
  const [mainRanking,setMainRanking] = React.useState('')
  const [additionalRanking,setAdditionalRanking] = React.useState('')
  const [weight,setWeight] = React.useState(-1)

    return (
      <>
        <h1>Welcome to Tab 3.</h1> 
        <section id = "tab3">
        <div className = 'title'>School Selection</div>
        <Autocomplete
          multiple
          id="checkboxes-tags-demo"
          options={colleges.sort((a,b)=> -b.localeCompare(a))}
          groupBy={(option) => option[0]}
          disableCloseOnSelect
          getOptionLabel={(option) => option}
          renderOption={(props, option, { selected }) => (
            <li {...props}>
              <Checkbox
                icon={icon}
                checkedIcon={checkedIcon}
                style={{ marginRight: 8 }}
                checked={selected}
              />
              {option}
            </li>
          )}
          renderInput={(params) => (
            <TextField {...params} label="Search for Colleges To Compare" placeholder="College" />
          )}
          onChange={(event, value) => {
            setCollege(value)
          }}
        />
        <div className ='compare'>
          <Button variant="contained" sx={{ width: 790}} onClick = {() => {
            if (college.length === 0){
              alert('You have not chosen any college to compare.')
              return
            }
            if (JSON.parse(window.localStorage.getItem("data").length === 0)){
              alert('You have not chosen any ranking criteria.')
              return
            }
            window.localStorage.setItem("colleges",JSON.stringify(college))
            // navigate('../Tab4',{relative: "path"})
          }}>
            Compare
          </Button>
        </div>
        <div className='ranking-header'>Select your Rankings</div>
        <div className='container'>
          <Autocomplete
            disablePortal
            id="combo-box-demo"
            className='tab'
            options={main}
            renderInput={(params) => <TextField {...params} label="Choose Main Ranking" />}
            onChange = {e => setMainRanking(e.target.innerHTML)}
          />
          <Autocomplete
            disablePortal
            id="combo-box-demo"
            className = 'tab'
            options={add}
            renderInput={(params) => <TextField {...params} label="Choose Additional Ranking (Optional)" />}
            onChange = {e => setAdditionalRanking(e.target.innerHTML)}
          />
          <TextField id="outlined-basic" label="Weight (0 to 1)"  variant="outlined"
            onChange = {e => setWeight(parseFloat(e.target.value))} />
          <br></br>
          <Button variant="contained" 
            onClick = {() => {
              if (mainRanking === '') {
                alert('Please Choose Main Ranking')
                return
              }
              if (weight < 0 || weight > 1){
                alert('Please provide appropriate weight')
                return
              }
              const currentUser = JSON.parse(window.localStorage.getItem("data"))
              currentUser.push({
                main : mainRanking,
                add : additionalRanking,
                weight : weight
              })
              window.localStorage.setItem("data", JSON.stringify(currentUser))
              window.location.reload()
            }}>
              Add
            </Button>
        </div>
        </section>
        <br></br>
        <Table></Table>
      </>
    );
}
